window.bookSummaryJSON = "<p>With magic declassified in the UK, the fake psychics and fraudulent healers are running amok, and it's up to the Department of Extradimensional Affairs' newly appointed Skepticism Officers to crack down. But when they set their sights on Modern Miracle, a highly suspicious and fast-growing faith healing cult with remarkably good social media presence, even their skepticism is put to the test.</p> <p>Is Modern Miracle on the level? Is Miracle Megâ€™s healing magic real? Why do dead bodies keep showing up on their doorstep? And just what is Miracle Dad's preferred flavour of crisp?</p> <p>In <i>Existentially Challenged</i>, the sequel to <i>Differently Morphous</i>, the men and women of the Department of Extradimensional Affairs continue their struggle to uncover the motives of the Ancients under the ever-present threat of death, insanity, and sensitivity training.</p>"; 
